import React from 'react';
import '../App.css';
import { Link } from 'react-router-dom';
import logoLube from '../logoLube.png';

const Logo = () => {
  return <div className="NavbarLogo" >
    <img src={logoLube} style={{ height: '90%', width: '5%' }} />
    <h1>DASHBOARD</h1>
  </div>
}

function Navbar() {
  return (
    <div className="Navbar">

      <div className="NavbarInterna">
        <Logo />

        <ul className="Links">
          <Link style={{ color: '#fff', textDecoration: 'none' }} to="/" >
            <li>Home</li>
          </Link>
          <Link style={{ color: '#fff', textDecoration: 'none' }} to="/about" >
            <li>About</li>
          </Link>
          <Link style={{ color: '#fff', textDecoration: 'none' }} to="/contact" >
            <li>Contact</li>
          </Link>
        </ul>
      </div>
    </div>
  );
}

export default Navbar;
